pragma solidity ^0.8.0;

abstract contract sto_Initializable {
    struct InitializableLayout {
        bool initialized;
    }

    bytes32 internal constant INITIALIZABLE_STORAGE_POSITION =
        keccak256(abi.encode("teller_protocol.context.initializable.v1"));

